const searchResult = (state = [-1], action) => {
  switch (action.type) {
    case 'UPDATE_SEARCH_RESULT':
      let array = [action.success];
      array.concat(action.result);
      console.log(array)
      state = array;
      return state
    default:
      return state
  }
}

export default searchResult
